create table player
(
    nickname    varchar,
    player_id   integer not null
        constraint player_pk
            primary key,
    wikidata_id varchar,
    player_name varchar,
    similarity  real,
    dob         timestamp
);

alter table player
    owner to postgres;

create index player_dob_idx
    on player (dob);

create index player_player_id_idx
    on player (player_id);

create index player_similarity_idx
    on player (similarity);

grant select on player to inode_readonly;

